const e={title:"What is emergent",p1:"EMERGENT.HK is a global technology company providing nostr/web3/blockchain solutions for developers, startups, enterprises, and governments.",p3:"Nostr is designed for simplicity and enables people to participate in a decentralized social network. It can not only replace twitter/facebook/instagram/spotify/etc but can also replace companies that provide infomation exchange services."},t={title:"What we do",p1:"Hong Kong is currently pursuing Web3.",p2:'Nostr + Bitcoin + Lightning is an organic form of "Web3" that has a chance of being around in 5-10 years.',p3:"Nostr + Bitcoin + Lightning are networks and technologies that are discovered in response to real problems experienced by real people.",p4:"These networks are rapidly growing without a development team, without a marketing team, without leadership, and without any form of capital raise."},o={title:"Trusted By",p1:'Intoduce yourself to the HK community (or just say hi) on <a href="https://snort.social/e/note134slxdr2np6ml5f459me8cfmzg6cgw46c2agv55mtq55mtdtcgaqu4af4l">this thread</a> to receive a DM about the next meetup.',p2:`If you're new to to nostr, the most popular nostr apps are <a href="https://apps.apple.com/us/app/damus/id1628663131">Damus</a> (iPhone), <a href="https://github.com/vitorpamplona/amethyst/releases/latest">Amethyst</a> (Android), and <a href="https://iris.to/">iris.to</a> (web).`},s={title:"Services Provided",p1:"EMERGENT.HK is a global technology company providing nostr/web3/blockchain solutions for developers, startups, enterprises, and governments."},a={title:"project1",p1:"project description"},n="Current time:",r={whatIs:e,nostrVsWeb3:t,TrustedBy:o,Service:s,Solution:a,currentTime:n};export{s as Service,a as Solution,o as TrustedBy,n as currentTime,r as default,t as nostrVsWeb3,e as whatIs};
